import React from 'react';
import './ItemListContainer.css'; // Asegúrate de importar tu archivo CSS

const ItemListContainer = ({ greeting }) => {
    return (
        <div className="container">
            <h1 className="greeting">Bienvenidos a mi Proyecto</h1>
        </div>
    );
}

export default ItemListContainer;
